/**
 * File: PlayerCard.js
 * Version: Pre-Production
 * Created by: K. Zimmerman
 * Project: kc_royals_backend
 * Description:
 * - Displays individual player information in a Bootstrap-styled card.
 */

import React from "react";

const PlayerCard = ({ player }) => {
  return (
    <div className="card mb-3">
      <div className="card-body">
        <h5 className="card-title">
          {player.first_name} {player.last_name}
        </h5>
        <p className="card-text">Position: {player.position}</p>
        <p className="card-text">Team: {player.team}</p>
      </div>
    </div>
  );
};

export default PlayerCard;
